export default function Slider() {
	return (
		<>
			<div class="wrapper">
				<div class='header'>

				</div>
				<ul id="slider">
					<li class="slide"><img src={`${process.env.PUBLIC_URL}/assets/img/slider/slider-1.png`} width="100%" height="400px" /></li>
					<li class="slide"><img src={`${process.env.PUBLIC_URL}/assets/img/slider/slider-2.png`} width="600px" height="400px" /></li>
					<li class="slide"><img src={`${process.env.PUBLIC_URL}/assets/img/slider/slider-3.png`} width="600px" height="400px" /></li>
				</ul>
			</div>

		</>
	);
}
